import React from 'react';
import logo from './logo.svg';
import './App.css';
import  {


BrowserRouter,
Route,
Switch

} from "react-router-dom"
import Landing from "./landing";

class App extends Component {
  render(){
    return(
     <BrowserRouter> 
     <Switch>
       <Route path="/">
         <Landing></Landing>
       </Route>
       </Switch>  
       </BrowserRouter> 

     )
  }
}




export default App;
